import React, { useState, useEffect } from "react";
import { getNewspapers } from "../services/api"; // ✅ Import API function

function Explore() {
  const [newspapers, setNewspapers] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const data = await getNewspapers(); // ✅ Use API function
      console.log("Fetched newspapers:", data); // Debugging
      setNewspapers(data);
    }

    fetchData();
  }, []);

  return (
    <div>
      <h1>Explore Newspapers</h1>
      <ul>
        {newspapers.map((paper) => (
          <li key={paper.id}>
            {paper.name} - ₹{paper.price_per_word} per word
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Explore;
